import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function MyInfo() {
    return (
    <div>
    <h1>
        John Rendleman
    </h1>
    <p>
        My name is John Rendleman and I am a senior at UNC Chapel Hill and I am doing freeCodeCamp.org's reactJS tutorial.
    </p>
    <h2>
        Top Vacation Spots:
    </h2>
    <ol>
        <li>Bahamas</li>
        <li>London</li>
        <li>Singapore</li>
    </ol>
    </div>
    )
};


ReactDOM.render(
    <MyInfo />,
    document.getElementById("root")
);
